@TimmermansEU Managing migration requires financial investment.
The next Multiannual Financial Framework - the EU's 7-year budget - should reflect the experience of the past 3 years &amp; provide flexible instruments to respond to future migratory challenges.
#EUBudget #MigrationEU #FutureofEurope https://t.co/nBI8joZ9Ep

@TimmermansEU The EU needs to offer an alternative to perilous journeys by opening safe and legal pathways for those in genuine need of protection. 
This will require Member States to resettle a further 50,000 vulnerable refugees by May 2019.
#MigrationEU https://t.co/mHUV1Y1D23

@TimmermansEU The EU needs a robust and effective system for sustainable migration management for the future.
The weaknesses in the design and implementation of the current EU asylum system have led to differing treatment of asylum seekers &amp; varying recognition rates across the EU
#MigrationEU https://t.co/ty03DwxAid
